import React from "react";
import { fashionRunway } from "../assets";
import { Link } from "react-router-dom";

export const NotFound = () => {
  return (
    <div className="relative">
      <img
        src={fashionRunway}
        className="absolute w-full h-auto object-cover -z-50"
        alt=""
      />
      {/* <h1 className="text-9xl font-bodyFont font-extrabold text-transparent shadow-2xl drop-shadow-2xl w-fit backdrop-blur-md bg-clip-text"> */}
      <div className="flex flex-col justify-between items-center w-fit gap-10 mx-auto relative px-20 py-32">
        <div className="flex flex-col  justify-center items-center w-fit relative">
          <span className="text-9xl relative font-bodyFont font-extrabold text-transparent bg-contain bg-404 bg-clip-text before:bg-white before:content-[''] before:absolute  before:bottom-0 before:-left-1 before:w-full before:h-5/6  before:-z-20  before:-rotate-2">
            404 Error !
          </span>
        </div>
        {/* <span className="text-[12rem] font-bodyFont w-fit font-extrabold text-white drop-shadow-2xl shadow-green-400">
          :
        </span> */}
        <div className=" stroke-white stroke-1 relative w-fit text-8xl bg-contain text-center font-extrabold text-transparent bg-404 bg-clip-text before:bg-white before:content-[''] before:absolute  before:bottom-0 before:-left-1 before:w-full before:h-full  before:-z-20 before:top-2  before:-rotate-2">
          Fashion Emergency
        </div>
        <div className="mt-10 w-fit text-5xl text-center font-extrabold text-white text-shadow-lg">
          You've entered the realm of style mysteries !
        </div>
        <Link to="/">
          <button className="relative z-40 py-2 font-light font-titleFont px-6 border text-xl bg-white cursor-pointer duration-200 hover:bg-gray-300 hover:border-gray-400 active:bg-gray-400 active:scale-[0.98] text-black">
            Take me back to the fabulous homepage!
          </button>
        </Link>
      </div>
    </div>
  );
};
